INSERT INTO `meet` (`MEE_ID`, `title`, `date`, `subject`, `text`, `created_at`, `enable`, `school_id`, `author_id`, `publisher_id`, `updated_at`) VALUES (1,'Compte-rendu de la runion du Chioni','2014-09-03 00:00:00','Prparation de la rentre 2014-2015 + divers sujets','<div>Compte-rendu de la r&eacute;union du Chioni &ndash; 03/09/2014</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>L&rsquo;objet de la r&eacute;union : Pr&eacute;paration de la rentr&eacute;e 2014-2015 + divers sujets&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Les personnes pr&eacute;sentes : Ali ; Fahar ; Amina ; Amina Oummou Mika&icirc;l ; Mou&icirc;nah ; Inaya ; Zali-</div>\r\n\r\n<div>Rahmatoullah ; Foundi Ahmad.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Intervention de Ali : en introduction, il est rappel&eacute; les efforts effectu&eacute;s l&rsquo;ann&eacute;e pr&eacute;c&eacute;dente par&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>l&rsquo;&eacute;quipe du chioni qui a en &eacute;t&eacute; remerci&eacute;e.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>1/ Il a &eacute;t&eacute; soulign&eacute; que des enseignements tir&eacute;s de l&rsquo;ann&eacute;e scolaire pass&eacute;e devaient servir pour&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>pr&eacute;parer au mieux cette nouvelle rentr&eacute;e 2014-2015.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>2/ Il a &eacute;t&eacute; d&eacute;cid&eacute; d&rsquo;organiser une r&eacute;union toutes les 2 semaines au chioni avec pour objet le suivi des&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>enseignements et la progression des &eacute;l&egrave;ves.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Remarque : la question des &eacute;valuations r&eacute;guli&egrave;res du travail et des progr&egrave;s des &eacute;l&egrave;ves compar&eacute;s aux&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>objectifs par classe a &eacute;galement &eacute;t&eacute; &eacute;voqu&eacute;e.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>3/ Les manuels de lecture et d&rsquo;&eacute;criture seront laiss&eacute;s au chioni pour &eacute;viter qu&rsquo;ils ne soient abim&eacute;s&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>mais des polycopi&eacute;s seront donn&eacute;s aux &eacute;l&egrave;ves si besoin. Les autres manuels (cultures islamiques etc.)&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>pourront &ecirc;tre amen&eacute;s &agrave; la maison par les &eacute;l&egrave;ves pour qu&rsquo;ils puissent r&eacute;viser.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>4/ Les horaires du chioni de Marseille sont les suivants : les samedi et dimanche de 9h30 &agrave; 12h et de&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>13h30 &agrave; 16h. Il n&rsquo;y aura plus de classe le mercredi.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Les enseignants seront regroup&eacute;s dans la mesure du possible avec :</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>- le samedi matin : Amina, Mou&icirc;nah, Hafsoiti.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>- Le samedi apr&egrave;s-midi : Foundi Ahmad, Foundi Mansour, Ali, Fahar</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>- Le dimanche matin : Amina oummou Mika&icirc;l, Amina, Inaya, Mou&icirc;nah</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>- Le dimanche apr&egrave;s-midi : Foundi Ahmad, Mansour</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Le secr&eacute;tariat sera assur&eacute; le dimanche matin par Zali-Rahmatoullah</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>5/ Les cours de religion seront propos&eacute;s les 2&egrave;me</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>pr&eacute;ciser). + Les 2&egrave;me</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>6/ Des attributions ont &eacute;t&eacute; confi&eacute;es aux personnes suivantes :</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>- Fahar : suivi et tenue de la tr&eacute;sorerie</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>- Hafsoiti en bin&ocirc;me avec Foundi Mansour : lecture du Quran</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>- Mansour : &eacute;laboration des objectifs par classe et suivi de ces objectifs</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>- Mou&icirc;nah + Foundi Ahmad + Inaya + Amina + Amina Oummou Mika&icirc;l : polyvalents dans les&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>t&acirc;ches administratives et les autres t&acirc;ches (entretien des salles etc.)</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>&nbsp;et 4&egrave;me</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>7/ La question du changement des tatuts de l&rsquo;association de Marseille a &eacute;t&eacute; abord&eacute;e. Les&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>rectifications concerneront le lieu du si&egrave;ge et la personne en charge du secr&eacute;tariat. Ces&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>modifications ont &eacute;t&eacute; motiv&eacute;es par le d&eacute;p&ocirc;t du dossier de contrat aid&eacute; :</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>C&rsquo;est lors de l&rsquo;instruction de la demande qu&rsquo;il a &eacute;t&eacute; conseill&eacute; au Pr&eacute;sident de l&rsquo;association de&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Marseille de faire en sorte que le si&egrave;ge de l&rsquo;asso soit &agrave; l&rsquo;adresse du chioni (30 rue du g&eacute;nie) et que la&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>secr&eacute;tairede l&rsquo;asso n&rsquo;ait pas de lien familial avec le b&eacute;n&eacute;ficiaire du contrat aid&eacute; (Foundi Ahmad).</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Il a &eacute;t&eacute; d&eacute;cid&eacute; que Zali-Rahmatoullah serait la secr&eacute;taire de l&rsquo;asso dans les statuts en attendant&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>qu&rsquo;Inaya qui avait &eacute;t&eacute; propos&eacute;e en premier lieu soit form&eacute;e.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>8/ Relance des impay&eacute;s de cotisations : environ 10 personnes sont en retard des cotisations cf. ann&eacute;e&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>scolaire 2013-2014. Ces montants s&rsquo;&eacute;l&egrave;vent &agrave; un total d&rsquo;environ 800 &euro;.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>La question a &eacute;t&eacute; pos&eacute;e de savoir qui se chargerait de la relance des impay&eacute;s. Il a &eacute;t&eacute; d&eacute;cid&eacute; que le&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Tr&eacute;sorier s&rsquo;en chargerait. Le but est de faire un point mensuel sur ces impay&eacute;s afin d&rsquo;am&eacute;liorer leur&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>9/ Une r&eacute;union des parents d&rsquo;&eacute;l&egrave;ves est pr&eacute;vue environ 1 semaine apr&egrave;s la rentr&eacute;s des &eacute;l&egrave;ves qui&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>s&rsquo;est effectu&eacute;e le week-end du 06-07 septembre 2014.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>10/ Le point sur l&rsquo;&eacute;tat des finances du chioni qui &eacute;tait pr&eacute;vu initialement n&rsquo;a pas pu se faire. Ce sujet&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>sera abord&eacute; ult&eacute;rieurement lors d&rsquo;une autre r&eacute;union.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>11/ S&rsquo;agissant de la section vente du chioni : Djamal Abou Mohammad a habilit&eacute; Mou&icirc;nah et le reste&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>de l&rsquo;&eacute;quipe pour les articles.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Il est n&eacute;cessaire de tenir un r&eacute;capitulatif de ces ventes dans un livret &agrave; part.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>12/ Il a &eacute;t&eacute; d&eacute;cid&eacute; de relancer la vente des T-shirts enfants avec le logo de Msada wa heri. Le produit&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>des ventes devrait servir &agrave; financer le billet d&rsquo;avion de la personne d&eacute;sign&eacute;e pour aller sur place aux&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Comores. Cette personne aura en charge de faire avancer le projet humanitaire et da&rsquo;wah sur place.&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>13/ Le projet de Madressah-hitima qui consiste en la m&eacute;morisation du Quran a &eacute;t&eacute; &eacute;voqu&eacute;.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Il sera test&eacute; pendant le mois de septembre 2014 (de 17h &agrave; 18h ou de 18h &agrave; 19h) puis si le test est&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>concluant, le projet sera prolong&eacute; tout le reste de l&rsquo;ann&eacute;e scolaire. Les cours sont pr&eacute;vus pour avoir&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>lieu tous les jours au chioni sauf les samedi et dimanche.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Ces cours seront payants : 5 &euro;/mois pour les cotisants au chioni ou 15 &euro;/mois pour les non-membres.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>14/ Il est pr&eacute;vu d&rsquo;organiser 3 f&ecirc;tes en cours d&rsquo;ann&eacute;e : Mawlid + f&ecirc;te de l&rsquo;&eacute;cole + le jour de ^Achoura&nbsp;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>(10 de al Mouharram)</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>A ces occasions, il est rappel&eacute; de ne pas oublier d&rsquo;inviter les notables de la communaut&eacute; comorienne</div>','2014-10-02 18:18:40',1,3,1,1,'2018-12-20 12:21:52'),(2,'Reunion Bilan 2016/2017','2017-08-04 00:00:00','Reunion Bilan 2016/2017','nous allons attaquer la 5e anne du chioni, on n\'oublie pas que nous avons commencs avec seulement 40 lves ds lors des dmarche porte--porte ont t ncessaires et nous ont aid pour augmenter ce volume. Masha\'Allah au fur  mesure des prcdentes annes la mobilisation et moindre. Le nombre d\'lves s\'est stabilis. car on est facilite par le fait que les gens nous connaissent et viennent de mme vers le chioni.\r\n\r\nLe Chioni et une aide pour prparer notre tombe et un moyen d\'viter de tomber dans le pch par le fait d\'tre prsent et non d\'autres ailleurs qu\'au chioni pour faire le bien\r\n\r\nIl faut que l\'on se motive pour le bien la ligne il faut cesser de se reposer les uns sur les autres mais pensez que sans nous la chose n\'avancera pas ou ne sera pas fait. que le chioni ne fonctionnera pas seul s\'intresser plus au chioni et les diffrentes tches.','2017-08-06 08:48:07',1,1,1,1,'2018-12-20 12:21:52'),(3,'Runion membres administration','2018-09-24 00:00:00','tat des lieux des dmarches','* Status des diffrentes dmarches\r\n - urbanisme on passe le 29 septembre\r\n - Nettoyage faade OK\r\n - Toiture en cours\r\n - Socit d\'amiante mercredi a 15h\r\n - Devis Expert en attente, continuons  les relancer\r\n\r\n* Enveloppe de dons\r\nActuellement on a 1300 de dons rcolts, des enveloppes sont encore  remettre a Fahari.\r\n\r\n* Possibilit de pourvoir accueillir les 19 personnes ?\r\nNon on ne peut pas accueillir du public\r\n\r\n* Avancer les travaux avant que le devis soit valid\r\nAli pense qu\'il faudrait commencer les travaux avant le go de l\'expert, si la commission nous a donner une rponse favorable.\r\nFoundi voudrais qu\'on appele Ibrahim la personne qui a fait le devis (donc peinture, faux plafond, plafond, porte).\r\n\r\nLes organisme nous auront valid les travaux, et ce sont travaux que nous effectueront seulement pas autrement.\r\n\r\n\r\n* Runion de samedi maintenu ?\r\nOui','2018-09-24 18:28:14',1,1,1,1,'2018-12-20 12:21:52');
